import React from 'react';
import Slider from '@mui/material/Slider';
import Box from '@mui/material/Box';

function HomeLoan() {
    return (
        <>
            <div className="Emi_calculater_reacted">
                <div className="Emi_firsted_calculated">
                    <div className="Emi_first_field">
                        <div className="monthly_emi_pay">
                            <p>Monthly EMI Pay</p>
                            <p>₹ 61,725</p>
                        </div>
                        <div className="monthly_emi_pay">
                            <p>Monthly EMI Pay</p>
                            <p>₹ 61,725</p>
                        </div>
                    </div>
                    <div className="Emi_second_field">
                        <div className="Emi_loan_amount_fild">
                            <p>Loan Amount</p>
                            <input type="text" style={{ width: "50px" }} />
                        </div>
                        <div className='emi_slider'>
                            <Box sx={{ width: 300 }}>
                                <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
                            </Box>
                        </div>
                        <div>
                            <p>₹ 5 lakh</p>
                            <p>₹ 10 lakh</p>
                        </div>
                    </div>
                    <div className="Emi_second_field">
                        <div className="Emi_loan_amount_fild">
                            <p>Loan Amount</p>
                            <input type="text" style={{ width: "50px" }} />
                        </div>
                        <div className='emi_slider'>
                            <Box sx={{ width: 300 }}>
                                <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
                            </Box>
                        </div>
                        <div>
                            <p>₹ 5 lakh</p>
                            <p>₹ 10 lakh</p>
                        </div>
                    </div>
                    <div className="Emi_second_field">
                        <div className="Emi_loan_amount_fild">
                            <p>Loan Amount</p>
                            <input type="text" style={{ width: "50px" }} />
                        </div>
                        <div className='emi_slider'>
                            <Box sx={{ width: 400 }}>
                                <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
                            </Box>
                        </div>
                        <div>
                            <p>₹ 5 lakh</p>
                            <p>₹ 10 lakh</p>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default HomeLoan;
